  return (
    <S.HeaderWrapper>
      <S.HeaderContent>
        <S.Logo>
          <img src={logoSvg} alt="" />
          <strong>Room</strong>mates
        </S.Logo>
      </S.HeaderContent>
    </S.HeaderWrapper>
  );
};
